var accountId = Get<Guid>("UsrAccount");
var shopName = Get<string>("UsrShopName");
var city = accountId != Guid.Empty ? Get<string>("UsrAccountCity") : String.Empty;
var address = accountId != Guid.Empty ? Get<string>("UsrAccountAddress") : String.Empty;
//var filial = accountId != Guid.Empty ? Get<string>("UsrAccountFilial") : String.Empty;
var region = accountId != Guid.Empty ? Get<string>("UsrAccountRegion") : String.Empty;
var list = new List<string>() {
	shopName,
	city,
	address,
	//filial,
	region,
};
var accountEmail = String.Join(",", list.Where(s => !String.IsNullOrEmpty(s)));
Set("UsrAccountEmail", accountEmail);
return true;

var activityId=Get<Guid>("activityId");
var userConnection = (UserConnection)HttpContext.Current.Session["UserConnection"];
var emailClientFactory = ClassFactory.Get<EmailClientFactory>(new ConstructorArgument("userConnection", userConnection));
var activityEmailSender = new ActivityEmailSender(emailClientFactory, userConnection);
activityEmailSender.Send(activityId);
return true;
